public class SimplePriorityRule implements IPriorityRule {
  private String myHighPrioId;
  private String myLowPrioId;

  public SimplePriorityRule(String highPrioId, String lowPrioId) {
    myHighPrioId = highPrioId;
    myLowPrioId = lowPrioId;
  }

  @Override
  public boolean hasHigherPriority(IFunctionImplementation highPrio, IFunctionImplementation lowPrio) {
    return highPrio.getId().equals(myHighPrioId) && lowPrio.getId().equals(myLowPrioId);
  }
}
